import React, { useState } from 'react';

const VideoPlayer = () => {
  const [playing, setPlaying] = useState(false);
  const [muted, setMuted] = useState(true);

  const handleReady = () => {
    setPlaying(true);
    setMuted(false);
  };

  const handlePlay = () => {
    setPlaying(true);
    setMuted(false);
  };

  return (
    <div className="flex justify-center items-center w-screen h-screen">
      <video
        src="https://www.youtube.com/watch?v=d1_JKFy_fIk"
        className="rounded-lg"
        width="640"
        height="360"
        playing={playing}
        muted={muted}
        autoPlay={true}
        onReady={handleReady}
        onPlay={handlePlay}
        controls
        allowFullScreen
      ></video>
    </div>
  );
};

export default VideoPlayer;
